import React, {Fragment, useEffect} from 'react';
import {Redirect} from 'react-router-dom';


const LockChooser = props => {
    let redirect = false;
    function moveNext(e) {
        console.log('clicked');
        redirect = true;
    }
    if(redirect){
        console.log('in if');
        return <Redirect to = "/game-chooser" />
    }
    return(
        <Fragment>
            <h1>Select your lock</h1>
            <img src = {require('../images/masterLockPurple.jpg')} width = "200px" height = "200px" alt = "not found" onClick = {e => moveNext(e)}/>
            <img src = {require('../images/masterLockBrass.jpg')} width = "200px" height = "200px" alt = "not found" onClick = {e => moveNext(e)}/>
        </Fragment>
    )
}

export default LockChooser;
